import React from "react";
import MovieCard from "./Moviecard";

class MovieList extends React.Component{
 
    constructor() {
        super();
        
    }

    

    render(){ 
        return(
        <>
        <MovieCard movies = {this.state}/>
        </>
        )
    }
}

export default MovieList;
